$("#newRequestForm input[type='submit']").click(function() {
    var
      name = $("#newRequestForm input[name='name']").val(),
      contact = $("#newRequestForm input[name='contact']").val(),
      msg = $("#newRequestForm textarea").val(),
      file = $("#newRequestForm input[type='file']").val();
      valid_phone =  "/^((8|\+7)[\- ]?)?(\(?\d{3}\)?[\- ]?)?[\d\- ]{7,10}$/";
	  re = /^\d[\d\(\)\ -]{4,18}\d$/;
	  var valid = re.test(contact);

      /*console.log(name);
      console.log(contact);
      console.log(file);
      console.log(msg);*/
      if(name && contact && msg && file) {
        //console.log($("#newRequestForm .customUploadFile input[type='file']")[0].files[0]);

			if ($("#newRequestForm .customUploadFile input[type='file']")[0].files[0].size > 5000000)
			{
				$("#newRequestForm .infoMsg").text("Превышен допустимый размер файла").css("display","block");
				return false;
			}
			if($("#newRequestForm .customUploadFile input[type='file']")[0].files[0].type != "image/png" 
              && $("#newRequestForm .customUploadFile input[type='file']")[0].files[0].type != "image/jpeg") {
				$("#newRequestForm .infoMsg").text("Недопустимый тип файла").css("display","block");
				return false;
			}
			if (!valid) {
				$("#newRequestForm .infoMsg").text("Неверно введен номер. Телефон должен содержать только цифры").css("display","block");
				return false;
			}
      }
      else {
       $("#newRequestForm .infoMsg").text("Заполните все поля").css("display","block");
        return false;
      }

    return true;
});

